-- preferenze_alimentari_italia definition

DROP TABLE IF EXISTS preferenze_alimentari_italia;

CREATE TABLE preferenze_alimentari_italia (
	id INTEGER,
	data_nascita VARCHAR(50),
	eta INTEGER,
	genere VARCHAR(50),
	citta_residenza VARCHAR(50),
	regione_residenza VARCHAR(50),
	titolo_studio VARCHAR(50),
	cucina_italiana INTEGER,
	cucina_cinese INTEGER,
	cucina_giapponese INTEGER,
	cucina_indiana INTEGER,
	cucina_messicana INTEGER,
	cucina_mediorientale INTEGER,
	cucina_africana INTEGER,
	cucina_vegetariana INTEGER,
	cucina_vegana INTEGER,
	cucina_fastfood INTEGER
);

